import React from "react";

export default function Description() {
  return(
    <div className="descript">
      <p id="pc">
        デジタルデザイナー兼デベロッパーを目指し日々勉強中です。<br/>
        目指したきかっけは、私はモノづくりが好きで、モノづくりを通し周りの人の為に役に立つもの、また使いやすいシステムが作れたらいいと考えております。<br/>
        幼少期にドイツのミュンヘンに２年弱住んでおり、ヨーロッパ各地の都市を旅行しその地域で色々な人や物に触れるきっかけがあり、
      </p>
      <p id="phone">
      携帯
      </p>
    </div>
  );
}
